import Axios from 'axios'
import { setTeam } from './index'

export function fetchTeamData(payload) {
    return (dispatch, getState) => {
        Axios.get('https://api.collegefootballdata.com/teams?Team='+payload)
        let tempState = getState()
        dispatch(setTeam(payload))
    }
}
